import React, { useRef, useEffect } from 'react';
import { Link } from 'react-router-dom';
import css from './Rating.module.css';
import tikTokLikes from '../../icons/tiktokLikes.svg';
import TikTokViews from '../../icons/tiktokViews.svg';
import TikTokFollowers from '../../icons/tiktokFolowers.svg';
import StarsBlue from '../../icons/stars-blue.svg';
import StarsGreen from '../../icons/stars-green.svg';
import StarsOrange from '../../icons/stars-orange.svg';
import gsap from 'gsap';
import { ScrollTrigger } from 'gsap/ScrollTrigger';

gsap.registerPlugin(ScrollTrigger);

const Rating = () => {
  const sectionRef = useRef(null);
  const backgroundRef = useRef(null);

  // Создаем массив рефов для ссылок и элементов декора
  const linkRefs = useRef([]);
  const decorItemRefs = useRef([]);

  useEffect(() => {
    linkRefs.current.forEach((link, index) => {
      const decorItems = decorItemRefs.current[index]; // Достаем соответствующие элементы декора

      const handleMouseEnter = () => {
        gsap.to(link, {
          scaleX: 1.03,
          scaleY: 0.98,
          duration: 1,
          ease: 'elastic.out(1, 0.3)',
        });

        gsap.fromTo(
          decorItems,
          { translateX: '-100%' },
          {
            translateX: 0,
            duration: 0.4,
            stagger: 0.08,
          }
        );
      };

      const handleMouseLeave = () => {
        gsap.to(link, {
          scaleX: 1,
          scaleY: 1,
          duration: 1,
          ease: 'elastic.out(1, 0.3)',
        });

        gsap.to(decorItems, {
          translateX: '100%',
          duration: 0.4,
          stagger: 0.08,
        });
      };

      if (link) {
        link.addEventListener('mouseenter', handleMouseEnter);
        link.addEventListener('mouseleave', handleMouseLeave);
      }

      return () => {
        if (link) {
          link.removeEventListener('mouseenter', handleMouseEnter);
          link.removeEventListener('mouseleave', handleMouseLeave);
        }
      };
    });
  }, []);

  useEffect(() => {
    gsap.fromTo(
      backgroundRef.current,
      { yPercent: -15 },
      {
        yPercent: 30,
        ease: 'none',
        scrollTrigger: {
          trigger: sectionRef.current,
          start: 'top bottom',
          end: 'bottom top',
          scrub: true,
        },
      }
    );
  }, []);

  return (
    <section ref={sectionRef} className={css.rating}>
      <div ref={backgroundRef} className={css.backgroundImage}></div>
      <div className={css.ratingWrap}>
        <h1 className="section-title">Explore Other Stellar Services</h1>
        <p className={css.ratingText}>
          TikTok promotion made easy. Whether looking for likes, views or
          followers, you've come to the right place. Let StellarLikes do the
          work.
        </p>
        <div className={css.ratingWrapper}>
          {[
            {
              img: tikTokLikes,
              title: 'Likes',
              link: '/',
              color: 'pinkLink',
              starsImg: StarsBlue,
            },
            {
              img: TikTokViews,
              title: 'Views',
              link: '/tikTokViews',
              color: 'greenLink',
              starsImg: StarsGreen,
            },
            {
              img: TikTokFollowers,
              title: 'Followers',
              link: '/tikTokFollowers',
              color: 'orangeLink',
              starsImg: StarsOrange,
            },
          ].map((item, index) => (
            <div
              key={index}
              className={`${css.ratingBlock} ${css[item.color]}`}
            >
              <div className={css.ratingLinkBlock}>
                <div className={css.ratingContent}>
                  <img
                    className={css.ratingImg}
                    src={item.img}
                    alt={item.title}
                  />
                  TikTok <span className={css[item.color]}>{item.title}</span>
                </div>

                <div className={css.ratingStarsBlock}>
                  <img
                    className={css.ratingStarsImg}
                    src={item.starsImg}
                    alt="Stars"
                  />
                  <div className={css.ratingStarsText}>
                    Rated 4.9 of 5 of intergalactic stars
                  </div>
                </div>

                <p className={css.ratingStarsDescription}>
                  Our award-winning, instantly-delivered Instagram likes are
                  sourced from real and active users. Delivered in 60 seconds.
                </p>

                <div className={css.ratingLinkContent}>
                  <Link
                    ref={el => (linkRefs.current[index] = el)} // Используем реф для каждой ссылки
                    className={`${css.ratingLink} ${css[item.color]}`}
                    to={item.link}
                  >
                    <span className={css.linkText}>Buy {item.title}</span>
                    <span className={css.decor}>
                      <span
                        ref={el => {
                          if (!decorItemRefs.current[index])
                            decorItemRefs.current[index] = [];
                          decorItemRefs.current[index][0] = el;
                        }}
                        className={css.decorItem}
                      ></span>
                      <span
                        ref={el => {
                          decorItemRefs.current[index][1] = el;
                        }}
                        className={css.decorItem}
                      ></span>
                    </span>
                  </Link>
                  <div className={css.ratingStarsText}>Starting at $0.89</div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Rating;
